import React from "react";
import PropTypes from "prop-types";

todolist.propTypes = {
  todolist: PropTypes.array,
};
todolist.defaultProps = {
  todolist: [],
};

function todolist({todolist}) {
  return (
    <div>
      <ul>
        {todolist.map((key) => (
          <li key={todolist.key} style={{color: key}}>
            {key.color}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default todolist;
